import pandas as pd
import json
from glob import glob

def find_measurement_suffixes(file_path):
    df = pd.read_csv(file_path, nrows=2)  # Load only the headers
    return [col for col in df.columns if 'Enterococcus' in col]

def get_exceeding_samples(file_path):
    df = pd.read_csv(file_path)
    exceeds = {}
    for column in df.columns:
        if 'Enterococcus' in column:
            exceeds[column] = df[df[column] > 104]['Date'].tolist()
    return exceeds

def check_rain_prior(df, date_col, rain_cols):
    rain_dates = df[date_col][(df[rain_cols[0]] > 0) | (df[rain_cols[1]] > 0)]
    return rain_dates.tolist()

def calculate_percentage_failures(files):
    total_fails = 0
    fail_with_rain = 0

    for file in files:
        df = pd.read_csv(file)
        date_col = [col for col in df.columns if 'Date' in col][0]
        rain_cols = [col for col in df.columns if 'Rain' in col][:2]
        exceeds = get_exceeding_samples(file)

        fails = sum(len(v) for v in exceeds.values())
        total_fails += fails

        rain_dates = check_rain_prior(df, date_col, rain_cols)
        fail_with_rain += len(set(rain_dates).intersection(set(sum(exceeds.values(), []))))

    if total_fails == 0:
        return 0
    return round((fail_with_rain / total_fails) * 100, 2)

